I love the @elizabetharden Intensive Moisturizing Hand Treatment, although it comes with quite a hefty price tag. It’s ultra moisturising while not leaving a sticky touch & part of my bedtime skin routine. @aveenosg Skin Relief Hand Cream is great at soothing the itch on my dry hands, fragrance free, it also doesn’t form a sticky touch & with the price tag that comes along, I could use it every time after I wash my hands.
.
@nyr_sg Wild Rose Hand Cream & @crabtreeandevelyn_singapore Rosewater Overnight Hand Therapy, in the name of rose.... they smell totally different but both are great! I use them when I feel depressed (sian ah) and need for some mood lifting fragrance.
